        def save_matran(self,fileName):
            fileName = f"{fileName}"
            if fileName:
                # T·∫°o m·ªõi m·ªôt workbook
                wb = Workbook()
                ws = wb.active
                ws.column_dimensions['A'].width = 80
                ws.cell(row=1,column=1, value=f"D·∫°ng To√°n")
                ws.cell(row=1,column=2, value=f"Lo·∫°i C√¢u")
                ws.cell(row=1,column=3, value=f"M·ª©c ƒê·ªô")
                ws.cell(row=1,column=4, value=f"S·ªë C√¢u")
                # L·∫•y s·ªë h√†ng v√† s·ªë c·ªôt c·ªßa tableWidget
                num_rows = self.tableWidget.rowCount()
                num_cols = self.tableWidget.columnCount()

                # L·∫∑p qua t·ª´ng h√†ng v√† c·ªôt c·ªßa tableWidget ƒë·ªÉ l∆∞u d·ªØ li·ªáu v√†o file Excel
                for row in range(num_rows):
                    for col in range(num_cols):
                        # L·∫•y d·ªØ li·ªáu t·ª´ tableWidget
                        cell_value = self.tableWidget.item(row, col).text() if self.tableWidget.item(row, col) else ""
                        # Ghi d·ªØ li·ªáu v√†o cell t∆∞∆°ng ·ª©ng trong worksheet
                        ws.cell(row=row + 1, column=col + 1, value=cell_value)

                wb.save(f"{fileName}")
            return

        def load_matran(self):
            try:
                options = QtWidgets.QFileDialog.Options()
                options |= QtWidgets.QFileDialog.DontUseNativeDialog
                fileName, _ = QtWidgets.QFileDialog.getOpenFileName(self.tab_taode, "Ch·ªçn file ch·ª©a d·∫°ng to√°n", "", "Excel Files (*.xlsx);;All Files (*)", options=options)

                if fileName:                    
                    wb = load_workbook(fileName)
                    sheet = wb['Sheet']
                    # T√¨m s·ªë d√≤ng cu·ªëi c√πng c√≥ d·ªØ li·ªáu trong c·ªôt A
                    rows_count = 0                    
                    for row in sheet.iter_rows(min_row=1, max_row=sheet.max_row, min_col=1, max_col=1):
                        cell_value = row[0].value
                        # Ki·ªÉm tra √¥ c√≥ gi√° tr·ªã kh√¥ng r·ªóng
                        if cell_value is not None:
                            rows_count += 1

                    self.tableWidget.setRowCount(rows_count)  
                    
                    for i in range(1,rows_count+1):
                        cell_value = sheet.cell(row=i, column=1).value
                        dang_toan = sheet.cell(row=i, column=1).value                            
                        item = QTableWidgetItem(dang_toan)                            
                        self.tableWidget.setItem(i-1, 0, item)

                        loai_cau = sheet.cell(row=i, column=2).value
                        item = QTableWidgetItem(loai_cau)
                        item.setTextAlignment(Qt.AlignCenter)
                        self.tableWidget.setItem(i-1, 1, item)

                        muc_do = sheet.cell(row=i, column=3).value
                        item = QTableWidgetItem(muc_do)
                        item.setTextAlignment(Qt.AlignCenter)
                        self.tableWidget.setItem(i-1, 2, item)

                        so_cau = str(sheet.cell(row=i, column=4).value)
                        item = QTableWidgetItem(so_cau)
                        item.setTextAlignment(Qt.AlignCenter)
                        self.tableWidget.setItem(i-1, 3, item)
                    self.tableWidget.removeRow(0)
            except Exception as e:
                show_msg_box = ShowMessageBox(QMessageBox.Information, 'Th√¥ng b√°o l·ªói', f'L·ªói {str(e)}!')
                show_msg_box.exec_()


            return 
