        #T·∫°o ƒë√°p √°n tnmaker cho latex
        def tao_tnmaker_latex(self, name_thu_muc, list_ma_de, socau_TN, socau_DS, socau_TLN):
            current_directory = os.path.dirname(os.path.abspath(__file__))
            latex_folder_path = os.path.join(current_directory, 'LATEX')                
            goc_foler_path=os.path.join(latex_folder_path, name_thu_muc)             
            dapan_folder_path=os.path.join(goc_foler_path, f"DAP AN")
            ans_dapan_folder_path=os.path.join(dapan_folder_path, f"ans")

            #T·∫°o file ƒë·ªÉ in b·∫£ng ƒë√°p √°n
            so_made=len(list_ma_de)              
 
            wb = Workbook()
            ws = wb.active            
            ws.cell(row=1,column=1, value=f"ƒê·ªÅ \\ C√¢u")           

            #ƒêi·ªÅn ƒë√°p √°n cho t·ª´ng d√≤ng            
            for i in range(so_made):
                #ƒêi·ªÅn t√™n m√£ ƒë·ªÅ
                ws.cell(row=1, column=i+2, value=list_ma_de[i])
                
                #X·ª≠ l√≠ ƒë√°p √°n tr·∫Øc nghi·ªám
                if socau_TN>0:
                        data = []  
                
                        file_path = os.path.join(ans_dapan_folder_path, f'ans{list_ma_de[i]}-1.tex')           
                
                        with open(file_path, "r") as file:
                            for line in file:                                
                                line = line.strip()
                                if len(line) == 1:
                                    data.append(line)                        
                                  
                        for j in range(1, len(data)+1):
                                ws.cell(row=j+1, column=i+2, value=data[j-1])

                #X·ª≠ l√≠ ƒë√°p √°n ƒë√∫ng-sai
                if socau_DS>0:
                        data = []                
                        file_path = os.path.join(ans_dapan_folder_path, f'ans{list_ma_de[i]}-2.tex')         
                
                        with open(file_path, "r") as file:
                            for line in file:                                
                                line = line.strip()
                                if len(line) == 36:
                                        dapan=""
                                        if line[5]=="T":
                                                dapan+=f"ƒê"
                                        if line[5]=="F":
                                                dapan+=f"S"
                                        if line[14]=="T":
                                                dapan+=f"ƒê"
                                        if line[14]=="F":
                                                dapan+=f"S"
                                        if line[23]=="T":
                                                dapan+=f"ƒê"
                                        if line[23]=="F":
                                                dapan+=f"S"
                                        if line[32]=="T":
                                                dapan+=f"ƒê"
                                        if line[32]=="F":
                                                dapan+=f"S"                                
                                        data.append(dapan)
                        
                        t=1       
                        for j in range(socau_TN+1, socau_TN+socau_DS+1):                                
                            ws.cell(row=j+1, column=i+2, value=data[t-1])
                            t+=1

                #X·ª≠ l√≠ ƒë√°p √°n tra loi ngan
                if socau_TLN>0:
                        data = []                
                        file_path = os.path.join(ans_dapan_folder_path, f'ans{list_ma_de[i]}-3.tex')         
                
                        with open(file_path, "r") as file:                                
                                for line in file:                                
                                        line = line.strip()
                                        if "Solution" not in line:
                                            dapan=line.replace("$","").replace("{","").replace("}","").replace(f"\\dapsoSA","")
                                            data.append(dapan)
                        print(data)
                        t=1
                        print("socau_TN+socau_DS+1=",socau_TN+socau_DS+1)
                        print("socau_TN+socau_DS+socau_TLN+1=",socau_TN+socau_DS+1)

                        for j in range(socau_TN+socau_DS+1, socau_TN+socau_DS+socau_TLN+1):                                
                                ws.cell(row=j+1, column=i+2, value=data[t-1])
                                t+=1              

            #ƒêi·ªÅn s·ªë c√¢u
            so_cau=socau_TN+socau_DS+socau_TLN
            for i in range(1, so_cau+1):
                ws.cell(row=i+1, column=1, value=i)            
            wb.save(f"{goc_foler_path}\\TNMaker_2025_SmartTest.xlsx")
            return

